import { View, Text, TouchableOpacity, Image, Animated } from 'react-native';
import React, { useCallback, useEffect, useState, useRef } from 'react';
import { Colors, CommonStyles } from 'src/styles';
import LinearGradient from 'react-native-linear-gradient';
import { wp } from 'src/lib/utilities';
import { useTranslation } from 'react-i18next';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { useIsConnected } from 'react-native-offline';
import { checkForUserChange, getListRouge } from 'src/models/auth';
import { Navigation } from 'react-native-navigation';
import SplashScreen from 'react-native-splash-screen';
import Lottie from 'lottie-react-native';
import Icons from 'react-native-vector-icons/FontAwesome5';
import { FlashList } from '@shopify/flash-list';
import { language } from 'i18next';
import { storage } from '../../index';
import { SkeletonLoad } from './SkeletonLoad';
import { TextInput } from 'react-native-paper';

const vehicule = {
  image:
    'data:image/jpeg;base64,',
};
const person = {
  image:
    'data:image/jpeg;base64,',
};

const ListRouge = function ({ componentId }) {
  const { t } = useTranslation();
  const isConnected = useIsConnected();
  const [searching, setSearching] = useState(false);
  const [found, setFound] = useState([]);
  const [laList, setLaList] = useState([]);
  const [internetErr, setInternetErr] = useState(false);
  const [textInputDis, setTextInputDis] = useState(true);

  const fadeAnim = useRef(new Animated.Value(1)).current;
  const fadeInput = useRef(new Animated.Value(0)).current;
  const position = useRef(new Animated.Value(0)).current;

  const rightToLeft = () => {
    Animated.timing(position, {
      toValue: wp(90),
      duration: 800,
      useNativeDriver: false,
    }).start();
  };
  const leftToRight = () => {
    Animated.timing(position, {
      toValue: 0,
      duration: 800,
      useNativeDriver: false,
    }).start();
  };

  const fadeIn = () => {
    // Will change fadeAnim value to 1 in 5 seconds
    Animated.timing(fadeAnim, {
      toValue: 1,
      duration: 500,
      useNativeDriver: false,
    }).start();
  };
  const fadeInInput = () => {
    // Will change fadeAnim value to 1 in 5 seconds
    Animated.timing(fadeInput, {
      toValue: 1,
      duration: 500,
      useNativeDriver: false,
    }).start();
  };

  const fadeOut = () => {
    // Will change fadeAnim value to 0 in 3 seconds
    Animated.timing(fadeAnim, {
      toValue: 0,
      duration: 700,
      useNativeDriver: false,
    }).start();
  };
  const fadeOutInput = () => {
    // Will change fadeAnim value to 0 in 3 seconds
    Animated.timing(fadeInput, {
      toValue: 0,
      duration: 700,
      useNativeDriver: false,
    }).start();
  };

  const initialize = useCallback(async () => {
    let li;
    let userData = await AsyncStorage.getItem('userData');
    const lastListRouge = storage.getNumber('lastListRouge');
    const listRouge = storage.getString('listRouge');
    if (!isConnected && listRouge) {
      setLaList(JSON.parse(listRouge));
      return;
    }
    if (!isConnected && !listRouge) {
      setInternetErr(true);
    }
    if (!lastListRouge || lastListRouge + 5 * 60 * 1000 < new Date().getTime()) {
      console.log('here');
      li = await getListRouge();
      console.log('li', li);
      storage.set('listRouge', JSON.stringify(li));
      storage.set('lastListRouge', new Date().getTime());
      setLaList(li);
    } else {
      console.log(JSON.parse(listRouge));
      setLaList(JSON.parse(listRouge));
    }
    userData = JSON.parse(userData);
    if (isConnected) {
      await checkForUserChange(userData);
    }
  }, [isConnected]);

  console.log('isArray', Array.isArray(laList));
  console.log(typeof laList);
  console.log('laList', laList);

  const handleSearch = () => {
    setSearching(true);
    setTimeout(() => {
      setFound([]);
      setSearching(false);
    }, 1000);
  };

  useEffect(() => {
    const listener = {
      componentDidAppear: () => {
        console.log('RNN', 'componentDidAppear');
        initialize();
        SplashScreen.hide();
      },
    };
    const unsubscribe = Navigation.events().registerComponentListener(listener, componentId);
    return () => {
      unsubscribe.remove();
    };
  }, [componentId, initialize, isConnected]);

  return (
    <LinearGradient
      colors={[Colors.primaryGradientStart, Colors.primaryGradientEnd]}
      style={CommonStyles.root}>
      <View style={{ flexDirection: 'row', marginTop: 10 }}>
        <Animated.View
          style={[
            { width: wp(10), flex: 1, height: wp(10), alignSelf: 'center' },
            { opacity: fadeAnim },
          ]}>
          <Lottie source={require('../assets/lottie/stop-sign.json')} autoPlay />
        </Animated.View>
        <Animated.View
          style={[
            {
              flex: 1,
              width: '100%',
              height: wp(10),
              alignItems: 'center',
              position: 'absolute',
              flexDirection: 'row',
              justifyContent: 'flex-end',
            },
            { opacity: fadeInput },
          ]}>
          <TextInput
            disabled={textInputDis}
            style={{ width: '80%', height: 40 }}
            placeholder={t('search')}
          />
          <TouchableOpacity style={{ marginHorizontal: '2%' }}>
            <Icons
              size={wp(6)}
              color={Colors.primaryDark}
              name={language === 'fr' ? 'arrow-alt-circle-rigth' : 'arrow-alt-circle-left'}
            />
          </TouchableOpacity>
        </Animated.View>
        <Animated.View style={{ position: 'absolute', right: position }}>
          <TouchableOpacity
            onPress={() => {
              if (position._value === wp(90)) {
                leftToRight();
                fadeIn();
                fadeOutInput();
                setTextInputDis(true);
              } else if (position._value === 0) {
                rightToLeft();
                fadeOut();
                fadeInInput();
                setTextInputDis(false);
              }
            }}>
            <Icons
              name="search"
              size={wp(6)}
              color={Colors.secondary}
              style={{ padding: 10, alignSelf: 'center' }}
            />
          </TouchableOpacity>
        </Animated.View>
      </View>
      <FlashList
        data={laList}
        keyExtractor={item => `${String(item._id)}_${item.type}`}
        ListEmptyComponent={
          <View style={{ alignSelf: 'center' }}>
            <SkeletonLoad marginTop={50} height={200} width={wp(90) > 340 ? 340 : wp(90)} />
          </View>
        }
        renderItem={({ item }) => {
          if (item.type === 'person') {
            return (
              <View
                style={{
                  backgroundColor: '#fff',
                  padding: 10,
                  borderRadius: 10,
                  width: wp(90) > 300 ? 300 : wp(90),
                  elevation: 10,
                  alignSelf: 'center',
                  marginVertical: 10,
                }}>
                <Image
                  source={{ uri: person.image }}
                  style={{
                    width: wp(90) > 300 ? 300 - 20 : wp(90) - 20,
                    height: 200,
                  }}
                />
                <Text style={{ textAlign: 'center' }}>{`${item.name} (${
                  item.NNI || t('no_nni')
                })`}</Text>
              </View>
            );
          }
          if (item.type === 'vehicle') {
            return (
              <View
                style={{
                  backgroundColor: '#fff',
                  padding: 10,
                  borderRadius: 10,
                  width: wp(90) > 300 ? 300 : wp(90),
                  elevation: 10,
                  alignSelf: 'center',
                  marginVertical: 10,
                  overflow: 'hidden',
                }}>
                <Image
                  source={{ uri: vehicule.image }}
                  style={{
                    width: wp(90) > 300 ? 300 - 20 : wp(90) - 20,
                    height: 200,
                  }}
                />
                <Text style={{ textAlign: 'center' }}>{`${item.model} (${item.matricule})`}</Text>
              </View>
            );
          }
        }}
      />
    </LinearGradient>
  );
};

export default ListRouge;
